import React from 'react';
import styled from 'styled-components';

const FooterStyles = styled`
div {
    background: yellow; 
}
ul {
    display: flex;
}
`

export default function Footer() {
    return (
        <FooterStyles>
        <div>
            <ul>
                <li>ln</li>
                <li>tw</li>
                <li>fb</li>
                <li>paint</li>
            </ul>
        </div>
        </FooterStyles>
    )
}
